			["customText"] = "function(expirationTime, duration, progress, formatedDuration, name, icon, stacks)\n    if not aura_env.region.text3 then\n        local text3 = aura_env.region:CreateFontString(nil, \"OVERLAY\")\n        aura_env.region.text3 = text3\n        aura_env.region.text3:SetFont(aura_env.region.text2:GetFont())\n        aura_env.region.text3:SetTextColor(1,1,1,1)\n        aura_env.region.text3:SetPoint(\"BOTTOMRIGHT\", aura_env.region, \"BOTTOMRIGHT\", -2, 1)\n        aura_env.region.text3:Show()\n    end\n    aura_env.region.text3:SetText(stacks)\nend",
			["cooldownSwipe"] = true,
			["customTextUpdate"] = "event",
			["automaticWidth"] = "Auto",
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["custom_hide"] = "timed",
						["subeventSuffix"] = "_CAST_START",
						["unit"] = "player",
						["duration"] = "5",
						["event"] = "Health",
						["names"] = {
