		["BM Priority Rotation "] = {
			["glow"] = false,
			["text1FontSize"] = 16,
			["authorOptions"] = {
			},
			["customText"] = "function ()\n    \n    \n    return aura_env.targetCount > 1 and aura_env.targetCount or nil\n    -- return aura_env.timeToReady\n    -- return aura_env.enhAbilityNames[ aura_env.recommended ]\nend\n\n\n\n\n",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["text2"] = "%p",
			["cooldownSwipe"] = true,
			["internalVersion"] = 11,
			["customTextUpdate"] = "update",
			["cooldownEdge"] = false,
			["icon"] = true,
			["triggers"] = {
				{
					["trigger"] = {
						["custom_hide"] = "timed",
						["type"] = "custom",
						["genericShowOn"] = "showOnActive",
						["custom_type"] = "status",
						["names"] = {
						},
						["custom"] = "function()\n    return true\nend",
						["event"] = "Health",
						["unit"] = "player",
						["customDuration"] = "function()\n    local gcd,gcdd = GetSpellCooldown(61304)\n    return gcdd,gcd+gcdd\nend\n\n\n\n\n\n\n",
						["spellIds"] = {
						},
						["events"] = "COMBAT_LOG_EVENT_UNFILTERED",
						["customIcon"] = "--Spell List\n--BOF-------- 火焰之息  (Breath of Fire)\n--KS--------------醉酿投  (Keg Smash)\n--BOS------------幻灭踢（Blackout Strike）\n--TP--------------猛虎掌（tiger palm）\n--CB-----------真气爆裂（Chi Burst）\n--CW-------------真气波（Chi wave）\n--BOB------------玄牛酒（Black Ox Brew）\n--RJW---------碧玉疾风  (Rushing Jade Wind)\n--ISB------------铁骨酒  (IronSkin Brew)\n\nfunction()\n    local spells = {}\n    spells.BOF = { id=115181, cost=0, power=nil }\n    spells.KS = { id=121253, cost=40, power=\"Energy\" }\n    spells.RJW = { id=116847, cost=0, power=nil, talentRow=6, talentCol=2 }\n    spells.CB = { id=123986, cost=0, power=nil, talentRow=1, talentCol=3 }\n    spells.TP = { id=100780, cost=25, power=\"Energy\" }\n    spells.BOS = { id=205523, cost=0, power= nil}\n    spells.BOB = { id=115399, cost=0, power=nil, talentRow=3, talentCol=3 }\n    spells.CW = { id=115098, cost=0, power=nil, talentRow=1, talentCol=2 }\n    spells.ISB = { id=115308, cost=0, power= nil} \n    spells.ISBproc = { id=215479, cost=0, power= nil} \n    local now = GetTime()\n    for k,v in pairs(aura_env.targets) do\n        if now - v > aura_env.targetWipeInterval then\n            aura_env.targets[k] = nil\n            aura_env.targetCount = max(0, aura_env.targetCount - 1)\n        end\n    end\n    \n    local gcdStart, gcdDuration = GetSpellCooldown(61304)\n    \n    if gcdDuration == 0 then\n        -- Estimate the global cooldown\n        gcdDuration = max(1, 1.5 / (1 + (GetHaste() / 100)))\n    end\n    \n    local function cd(spell)\n        local start,dura = GetSpellCooldown(spell.id)\n        local remaining = max(0, dura - (now - start))\n        return remaining > gcdDuration, remaining\n    end\n    local function talented(spell)\n        if not spell.talentRow or not spell.talentCol then return true end\n        _, _, _, selected = GetTalentInfo(spell.talentRow,\n            spell.talentCol, GetActiveSpecGroup())\n        return selected\n    end\n    local function enoughPowerFor(spell)\n        return UnitPower(\"player\", Enum.PowerType[spell.power or \"Energy\"]) >= spell.cost\n    end\n    local function usable(spell)\n        if not talented(spell) or cd(spell)\n        then return false end\n        \n        --if not enoughPowerFor(spell)\n        --then return false end\n        \n        return IsUsableSpell(spell.id)\n    end\n    local function icon(spell)\n        \n        \n        local name = GetSpellInfo(spell.id)\n        local range = IsSpellInRange(name, \"target\")\n        if range == 0 then\n            WeakAuras.regions[aura_env.id].region:Color(1,0,0,1)\n        else\n            WeakAuras.regions[aura_env.id].region:Color(1,1,1,1)\n        end\n        return GetSpellTexture(spell.id) or 939375\n    end\n    local function energyPct()\n        return (UnitPower(\"player\") / UnitPowerMax(\"player\")) * 100\n    end\n    local function buff(spell)\n        for i=1,40 do\n            local spellid = select(10,UnitBuff(\"player\",i))\n            if spellid == spell.id then return true end\n        end\n        return false\n    end\n    \n    \n    ------------------------Rotation Start From Here---------------------------\n    \n    if usable(spells.BOF)\n    then return icon(spells.BOF) end\n    \n    if usable(spells.KS)\n    then return icon(spells.KS) end\n    \n    if usable(spells.RJW)\n    and not buff(spells.RJW)\n    then return icon(spells.RJW) end\n    \n    if usable(spells.BOS)\n    then return icon(spells.BOS) end\n    \n    if usable(spells.TP)\n    and cd(spells.KS)\n    then return icon(spells.TP) end\n    \n    if usable(spells.CB)\n    then return icon(spells.CB) end\n    \n    if usable(spells.CW)\n    then return icon(spells.CW) end\n    \n    \n    \n    \n    return 939375\nend",
						["check"] = "update",
						["subeventPrefix"] = "SPELL",
						["subeventSuffix"] = "_CAST_START",
						["debuffType"] = "HELPFUL",
					},
					["untrigger"] = {
					},
				}, -- [1]
				{
					["trigger"] = {
						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["event"] = "Chat Message",
						["subeventPrefix"] = "SPELL",
						["events"] = "COMBAT_LOG_EVENT_UNFILTERED, PLAYER_REGEN_ENABLED",
						["genericShowOn"] = "showOnActive",
						["unevent"] = "auto",
						["custom_type"] = "event",
						["custom"] = "function (...)\n    local event, _, subtype, _, sourceGUID, sourceName, _, _, destGUID, destName, destFlags, _, spellID, spellName, _, amount, interrupt, a, b, c, d, offhand, multistrike  = ...\n    --print(...)\n    if event == 'PLAYER_REGEN_ENABLED' then\n        aura_env.targetCount = 0\n        return false\n    end\n    \n    local me = UnitGUID(\"player\")\n    \n    if aura_env.targets[destGUID] and ( subtype == 'UNIT_DIED' or subtype == 'UNIT_DESTROYED' ) then\n        aura_env.targets[destGUID] = nil\n        aura_env.targetCount = max( 0, aura_env.targetCount - 1 )\n        return false\n    end\n    \n    local hostile = ( bit.band( destFlags or 0, COMBATLOG_OBJECT_REACTION_FRIENDLY ) == 0 )\n    local time = GetTime()\n    \n    -- If being melee'd, count as a target.\n    if destGUID == me and sourceGUID ~= me and ( subtype == \"SWING_DAMAGE\" or subtype == \"SWING_MISSED\" ) then\n        if not aura_env.targets[sourceGUID] then\n            aura_env.targetCount = aura_env.targetCount + 1\n        end\n        aura_env.targets[sourceGUID] = time\n        return false\n    end\n    \n    -- Otherwise, just watch what I do.\n    if sourceGUID ~= me then\n        return false\n    end\n    \n    if hostile and sourceGUID ~= destGUID then\n        if subtype == 'SPELL_AURA_APPLIED'  or subtype == 'SPELL_AURA_REFRESH' or subtype == 'SPELL_AURA_APPLIED_DOSE' or \n        subtype == 'SPELL_PERIODIC_DAMAGE' or subtype == 'SPELL_PERIODIC_MISSED' or subtype == 'SPELL_DAMAGE' or subtype == 'SPELL_MISSED' or subtype == 'SWING_DAMAGE' or subtype == 'SWING_MISSED' then\n            if not aura_env.targets[ destGUID ] then \n                aura_env.targetCount = aura_env.targetCount + 1\n            end\n            \n            aura_env.targets[ destGUID ] = time\n            \n        end\n        \n    end\n    \n    return false\n    \nend\n",
